ora-two-find-root-causes-for-manager (OMO: class ora-two-manager-object {The ora-two-manager-object supporting target } ) = (class _ora-two-item-list  {List of root causes against the manager object,
Note that the caller must delete the returned list})
{This procedure finds the root causes associated with the manager object}
RootCauseNodes: class _ora-two-item-list;
Node: class object;
begin
    create an _ora-two-item-list RootCauseNodes;
    for Node = each object that is _an-ora-two-root-cause-object-of OMO do
        insert Node at the end of RootCauseNodes; 
    end;
    return RootCauseNodes;
end

ora-two-find-root-causes-for-object (Target: class object {The object for which to find the root cause of the alarm.} , OMO: class ora-two-manager-object {The ora-two-manager-object supporting target } ) = (class _ora-two-item-list  {List of root causes key to the failure of the target node.
Note that the caller must delete the returned list})
{This procedure finds the nodes that are responsible for the alarm on the target object, this list contains only non-terminal devices that are currently root causes.}
VisitedNodes,RootCauseNodes,CurrentNodes,NodesToTest: class _ora-two-item-list ;
Node,FirstNode: class object;
State:symbol;
Node-State: truth-value;
begin
    create an _ora-two-item-list RootCauseNodes;
    create an _ora-two-item-list VisitedNodes; 
    create an _ora-two-item-list NodesToTest; 
    insert Target at the beginning of NodesToTest; 
    repeat
        exit if the first item FirstNode in NodesToTest does not exist;
        remove FirstNode from  NodesToTest;
        insert FirstNode at the beginning of VisitedNodes;
        State = call _ora-two-get-state (FirstNode, OMO); 
        if State = the symbol _an-ora-two-ROOT-CAUSE-OBJECT-OF then begin
            insert FirstNode at the beginning of RootCauseNodes;
        end;
        CurrentNodes = call ora-two-recursive-collect-non-terminal-nodes (FirstNode,OMO);
        for Node = each object in CurrentNodes do
            node-state = call _ora-two-state-is-fail  (FirstNode, OMO); 
            if Node-State is true and 
            Node is not a member of VisitedNodes then 
                    insert Node at the end of NodesToTest;
        end;
        delete CurrentNodes;
    end;
delete VisitedNodes; 
delete NodesToTest;
return RootCauseNodes;
end

ora-two-find-down-nodes-FOR-ROOT-CAUSE (Target: class object {The Root cause object from which to start the search}, OMO: class ora-two-manager-object {The ora-two-manager-object supporting target }) = (class _ora-two-item-list {List of down items grouped by the failure of the target object})

{This procedure finds all of the down nodes assosicated with a root cause message, the returned list contains all nodes that are predicted to fail a poll, those that have failed a poll, and all of the root cause alarms surrounding those nodes.
Note that the caller must delete the returned list.}

VisitedNodes,sympathynodes,CurrentTNodes,CurrentNodes, NodesToTest: class _ora-two-item-list ;
Node,FirstNode,TNode, SN: class object;
node-state: truth-value;
NodeList: text;

begin
    create an _ora-two-item-list sympathynodes;
    create an _ora-two-item-list VisitedNodes; 
    create an _ora-two-item-list NodesToTest; 
    insert target at the beginning of NodesToTest;
    repeat
        exit if the first item FirstNode in NodesToTest does not exist;
        if demo-set then inform the operator for the next 2 minutes that "First Node: [the opfo-external-name of FirstNode]";
        remove FirstNode from  NodesToTest; 
        node-state = call _ora-two-state-is-fail (FirstNode, OMO);

        if node-state is true and FirstNode is not a member of VisitedNodes then 
        begin
            insert FirstNode at the beginning of SympathyNodes; 
            CurrentNodes = call ora-two-recursive-collect-non-terminal-nodes (FirstNode,OMO);
            for Node  = each object in CurrentNodes do
                insert Node at the end of NodesToTest;
            end;
            delete CurrentNodes;
            CurrentTNodes = call ora-two-recursive-collect-terminal-nodes (FirstNode,OMO); 
            for TNode = each object in CurrentTNodes do
                node-state = call _ora-two-state-is-fail (FirstNode, OMO);
                if node-state is true then
                    insert TNode at the beginning of SympathyNodes;
            end; 
            delete CurrentTNodes; 
        end;
        if FirstNode is not a member of VisitedNodes then     
            insert FirstNode at the end of VisitedNodes; 
    end; 
    delete VisitedNodes; delete NodesToTest;
    remove Target from SympathyNodes;
    if demo-set then
    begin
        NodeList = "[the name of this procedure]:";
        for SN = each object in SympathyNodes do
        NodeList = "[NodeList]
[the text of the names of SN]";
        end; {For}
        if the number of elements in SympathyNodes = 0 then NodeList = "Node List is --Empty--";
        {inform the operator for the next 2 minutes that "Number of Nodes = [the number of elements in SympathyNodes], [NodeList]";}
    end;
    return SympathyNodes;

End

ora-two-recursive-collect-passive-nodes (Target: class object {The object to collect passive-nodes} , OMO: class ora-two-manager-object {The ora-two-manager-object supporting target } ) = (class _ora-two-item-list {The list of collected passive-nodes.} )
{ora-two-recursive-collect-passive-nodes collects all passive nodes directly connected to target.}
PassiveNodesToVisit, VisitedPassiveNodes: class _ora-two-item-list;
PassiveNode: class object;
begin
    create an _ora-two-item-list VisitedPassiveNodes;
    create an _ora-two-item-list PassiveNodesToVisit; 
    call ora-two-collect-passive-nodes(Target, PassiveNodesToVisit, OMO);
    repeat
        exit if the first object PassiveNode in PassiveNodesToVisit does not exist;
        remove PassiveNode from PassiveNodesToVisit;
        if PassiveNode is not a member of VisitedPassiveNodes then 
        begin
            insert PassiveNode at the end of VisitedPassiveNodes;
            call ora-two-collect-passive-nodes(PassiveNode, PassiveNodesToVisit, OMO); 
        end;
    end;{repeat }
    delete PassiveNodesToVisit;
    if Target is a member of VisitedPassiveNodes then remove Target from VisitedPassiveNodes; 
    return VisitedPassiveNodes;
end

ora-two-recursive-collect-non-terminal-nodes (Target: class object {The object to collect non-terminal-nodes}, OMO: class ora-two-manager-object {The ora-two-manager-object supporting target } ) = (class _ora-two-item-list {The list of non-terminal nodes.})
{ora-two-recursive-collect-non-terminal-nodes collects all non-terminal-nodes directly connected to Target or connected through passive nodes.}
PassiveNodes: class _ora-two-item-list ;
PassiveNode: class object;
NonTerminalNodes: class _ora-two-item-list ;
begin
    create an _ora-two-item-list NonTerminalNodes;
    call ora-two-collect-non-terminal-nodes (Target, NonTerminalNodes, OMO);
    PassiveNodes = call ora-two-recursive-collect-passive-nodes (Target, OMO);
    for PassiveNode = each object in PassiveNodes do
        call ora-two-collect-non-terminal-nodes (PassiveNode, NonTerminalNodes, OMO);
    end;
    if Target is a member of NonTerminalNodes then remove Target from NonTerminalNodes;
    delete PassiveNodes;
    return NonTerminalNodes;
end

ora-two-recursive-collect-terminal-nodes (Target: class object {The object to collect terminal-nodes} , OMO: class ora-two-manager-object {The ora-two-manager-object supporting target } ) = (class _ora-two-item-list {The list of terminal nodes.} )
{ora-two-recursive-collect-terminal-nodes collects all terminal-nodes directly connected to Target or connected through passive nodes.} 
PassiveNodes: class _ora-two-item-list ;
PassiveNode: class object;
TerminalNodes: class _ora-two-item-list ;
begin
    create an _ora-two-item-list TerminalNodes;
    call ora-two-collect-terminal-nodes (Target, TerminalNodes, OMO);
    PassiveNodes = call ora-two-recursive-collect-passive-nodes (Target, OMO);
    for PassiveNode = each object in PassiveNodes do
        call ora-two-collect-terminal-nodes (PassiveNode, TerminalNodes, OMO);
    end;
    if Target is a member of TerminalNodes then remove Target from TerminalNodes;
    delete PassiveNodes;
    return TerminalNodes;
end

ora-two-release-object-states(OMO: class ora-two-manager-object {the Manager object to release})
{This procedure releases any objects that have registered ORA relations with the manager object  by deleting the relationships. Additionally empties internal reference lists and deletes unused poll objects. 
Note this is done on a per manager basis.}
Target:class object;
PSO:class _ora-two-poll-state-object;
begin
for Target = each object that is _an-ora-two-predicted-fail-object-of OMO do
    conclude that Target is not _an-ora-two-predicted-fail-object-of OMO; 
end;
for Target = each object that is _an-ora-two-poll-fail-object-of OMO do
    conclude that Target is not _an-ora-two-poll-fail-object-of OMO; 
end; 
for Target = each object that is _an-ora-two-root-cause-object-of OMO do
    conclude that Target is not _an-ora-two-root-cause-object-of OMO; 
end;
for Target = each object in the _ora-two-active-fail-list of OMO do
    remove Target from the _ora-two-active-fail-list of OMO;
end;
for Target = each object in the _ora-two-active-recover-list of OMO do
    remove Target from the _ora-two-active-recover-list of OMO;
end;
for PSO = each _ora-two-poll-state-object do
    if not (there exists an object that is _ora-two-poll-state-object-of PSO) then 
        delete PSO;
end;
end

ORA-TWO-GET-STATE (Target:class object {the object of intrest},OMO:class ora-two-manager-object {the setup object of the target}) = (symbol {the state of the object})
{Returns a symbol the repersents the ORA state of the object:
    Good = state is assumed to be good
    Predicted-fail = this object is predicted to fail poll
    Poll-fail = this object has failed a poll
    Root-cause = root cause failure}
User-state:symbol;
Internal-state:symbol;
begin
internal-state = call _ora-two-get-state (Target, OMO);
case (internal-state) of
   _an-ora-two-predicted-fail-object-of:
        User-state = the symbol Predicted-fail;
    _an-ora-two-poll-fail-object-of:
        User-state = the symbol Poll-fail;
    _an-ora-two-root-cause-object-of :
        User-state = the symbol Root-cause;
    otherwise : User-state = the symbol Good;
end;
return User-state;
end

