g2:c.METHOD.g2:a.TEXT:
_ora-two-collect-related-nodes (Initial-Node:class object {node to begin}, OMO:class ora-two-manager-object {Manager node to collect related nodes}) = (class _ora-two-item-list { list of related nodes }) 
Related-nodes:class ora-two-cluster-list;
Test-nodes:class _ora-two-item-list; 
To-visit-list:class _ora-two-item-list; 
Node:class object;
begin
create an  ora-two-cluster-list Related-nodes;
{transfer Related-nodes to this workspace;}
create an _ora-two-item-list Test-nodes;
create an _ora-two-item-list To-Visit-List;
insert Initial-Node at the beginning of Related-nodes;
insert Initial-node at the beginning of To-Visit-List;
repeat
    exit if the first object Node in To-Visit-List does not exist;
    remove Node from To-Visit-List;
    allow other processing;
    {  collect all the nodes associated with the working node }
    call ora-two-collect-non-terminal-nodes (Node,Test-Nodes, OMO);
    call ora-two-collect-terminal-nodes (Node, Test-Nodes, OMO);
    call ora-two-collect-passive-nodes (Node, Test-Nodes, OMO); 
    for Node = each object in Test-nodes do
        if Node is not a member of Related-nodes then begin
            insert Node at the end of Related-nodes;
            insert Node at the end of To-Visit-List;
        end;
        remove Node from Test-nodes;
    end;
end;
delete Test-nodes;
delete To-Visit-List;
return Related-nodes; 
end

g2:c.PROCEDURE.g2:a.TEXT:
_ora-two-common-poll (Dev: class object,OMO:class ora-two-manager-object)
PSO:class _ora-two-poll-state-object;
Poll-State:symbol;
begin 
if not (there exists an _ora-two-poll-state-object PSO that is _ora-two-poll-state-object-of Dev) then begin 
    create a _ora-two-poll-state-object PSO;
    {transfer PSO to this workspace at (random(-30,30),random(-30,30));}
    conclude that PSO is _ora-two-poll-state-object-of DEV; 
    Poll-State = call ora-two-poll-node (Dev, OMO);
    if PSO exists then begin
        if Poll-State is Fail then 
            conclude that the ora-two-poll-state of PSO = the symbol FAIL
        else
            conclude that the ora-two-poll-state of PSO = the symbol OK;
    end;
end;
end

_ora-two-state-is-fail (Target:class object ,OMO:class ora-two-manager-object) = (truth-value)
node-State: truth-value = false;
begin
if   Target is _an-ora-two-PREDICTED-FAIL-OBJECT-OF OMO or
    Target is _an-ora-two-poll-fail-object-of OMO or
    Target is _an-ora-two-root-cause-object-of OMO then
    node-State = true;
return node-State;
end

_ora-two-set-state (Target: class object, State: symbol, OMO: class ora-two-manager-object)
begin 
    {Remove any existing relationship with OMO.}

    conclude that Target is not _an-ora-two-predicted-fail-object-of OMO; 
    conclude that Target is not _an-ora-two-poll-fail-object-of OMO; 
    conclude that Target is not _an-ora-two-root-cause-object-of OMO;

    case ( State) of
        _an-ora-two-predicted-fail-object-of:
        begin
            conclude that Target is _an-ora-two-predicted-fail-object-of OMO; 
            start ora-two-predicted-fail-method (Target,OMO);
        end; 
        _an-ora-two-poll-fail-object-of:
        begin
            conclude that Target is _an-ora-two-poll-fail-object-of OMO; 
            start ora-two-poll-fail-method (Target,OMO);
        end; 
        _an-ora-two-root-cause-object-of:
        begin
            conclude that Target is _an-ora-two-root-cause-object-of OMO; 
            start ora-two-root-cause-method (Target,OMO);
        end; 
        otherwise : start ora-two-poll-recover-method (Target,OMO) ;
    end;
end

_ora-two-fail-non-terminal-find-test-terminal-nodes (OMO: class ora-two-manager-object, Target: class object) = (class _ora-two-item-list)
NT-TerminalNodes, T-TerminalNodes: class _ora-two-item-list;
Dev: class object;
TestNodes: class _ora-two-item-list;
node-state: truth-value = true;
FirstNode: class object;
begin
    create an _ora-two-item-list TestNodes;
    NT-TerminalNodes = call ora-two-recursive-collect-terminal-nodes (Target, OMO);
    repeat
        exit if the first item FirstNode in NT-TerminalNodes does not exist;
        create an _ora-two-item-list T-TerminalNodes;
        T-TerminalNodes = call ora-two-recursive-collect-terminal-nodes (FirstNode, OMO);
        insert FirstNode at the end of T-TerminalNodes;
        for Dev = each object in T-TerminalNodes do
            if Dev is not a member of the _ora-two-active-fail-list of OMO then begin
                Node-State = call _ora-two-state-is-fail (Dev,OMO);
                exit if Node-State is false;
            end;
        end;
        if Node-State is false then insert Dev at the end of TestNodes;
        for Dev = each object in T-TerminalNodes do
            if Dev is a member of NT-TerminalNodes then
                remove Dev from NT-TerminalNodes;
        end;
        delete T-TerminalNodes;
    end;
    delete NT-TerminalNodes;
    return TestNodes;
end

