_ora-two-poll-device-list (OMO: class ora-two-manager-object { the ora-two setup object responsible for the domain objects in the Pass-list}, PASS-LST: class _ora-two-item-list {List of objects to poll}) = (class _ora-two-item-list {list of items from the input that failed when polled})
{This procedure returns a list of failed poll objects and removes failed objects from PASS-LST  }
FAIL-LST: class _ora-two-item-list;
Dev: class object;
PSO:class _ora-two-poll-state-object;
PI:class procedure-invocation;
poll-state:symbol;
begin
    create an _ora-two-item-list FAIL-LST;
    PI = this procedure-invocation;
    { ****  this is strategic code, don't change the next 4 lines !!! **** }
    for Dev = each object in PASS-LST do in parallel 
{inform the operator for the next 2 minutes that "starting poll for [the opfo-external-name of Dev]";}
 
       { if not (there exists a procedure-invocation that is _an-ora-two-procedure-currently-polling DEV) then 
            start _ora-two-common-poll (DEV,OMO);
        conclude that this procedure-invocation is _an-ora-two-procedure-currently-polling DEV;
        wait until there exists an _ora-two-poll-state-object PSO that is _ora-two-poll-state-object-of Dev checking every .1 second;
        wait until the ora-two-poll-state of PSO is not unknown checking every the ora-two-poll-complete-test-interval of OMO ;

        if the ora-two-poll-state of PSO = the symbol FAIL then begin
            remove Dev from PASS-LST;
            insert Dev at the end of FAIL-LST;
        end;} 
        Poll-State = call ora-two-poll-node (Dev, OMO); 
        if poll-state = the symbol FAIL then begin
            remove Dev from PASS-LST;
            insert Dev at the end of FAIL-LST;
        end; 
    end;

for DEV = each object that is _an-ora-two-object-being-polled-by this procedure-invocation do 
    conclude that this procedure-invocation is not _an-ora-two-procedure-currently-polling DEV; 
    if not (there exists a procedure-invocation that is _an-ora-two-procedure-currently-polling DEV) then 
            delete the _ora-two-poll-state-object that is _ora-two-poll-state-object-of Dev;
end;

return FAIL-LST;
end

ora-two-recover-method (Target: class object {the object that has received an indication that it is now responding }, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for the target })
{This is the main driving routine to call when a domain object recovers. ora-two will then analyze dependencies to determine the new local network state. }
Related-Objects: class _ora-two-item-list;
Sympathy-Objects: class _ora-two-item-list;
Fail-Lst: class _ora-two-item-list;
node-failed: truth-value;
Dev: class object;
State: symbol;
Type: symbol;
begin 

    insert Target at the end of the _ora-two-active-recover-list of OMO; 
    {    exit if already good   }
    Node-failed = call _ora-two-state-is-fail (Target,OMO);

    if Node-failed is false then begin
        remove Target from the _ora-two-active-recover-list of OMO; 
        return;
    end;
    {   Clear message   }
    call _ora-two-set-state (Target, the symbol _an-ora-two-RECOVERED-OBJECT-OF , OMO);

    


    {    Collect Related Objects   }
     Related-Objects = call ora-two-recursive-collect-non-terminal-nodes (Target, OMO);
    {    Remove those that have no messages against them  }
    for Dev = each object in Related-Objects do
        Node-failed = call _ora-two-state-is-fail (Dev,OMO);
        if Node-failed is false then 
            remove Dev from Related-Objects
        else begin
            if Dev is a member of the _ora-two-active-recover-list of OMO and
            Dev is a member of Related-Objects
                 then remove Dev from Related-Objects;
        end;
    end;
    {Dev = Each} {    Poll the bad nodes   }
    Fail-Lst = call _ora-two-poll-device-list (OMO, Related-Objects);
    {    Related Objects has new good devices  }
    for dev = each object in Related-Objects do
        if Dev is not a member of the _ora-two-active-recover-list of OMO then begin
            insert Dev at the end of the _ora-two-active-recover-list of OMO;
            start ora-two-recover-method (Dev, OMO);
        end; {Dev not a member}
    end;
    {Process those that failed, still bad, must be root cause  }
    for Dev = each object in Fail-Lst do
        State = call _ora-two-get-state (Dev, OMO); 
        if State /= the symbol _an-ora-two-root-cause-object-of then
            call _ora-two-set-state (Dev, the symbol _an-ora-two-ROOT-CAUSE-OBJECT-OF , OMO);
    end; { Dev = each }
    delete Related-Objects;
    delete Fail-Lst;
    {   Process Terminal Nodes if this is a non-terminal node }
    Type = call ora-two-node-type (Target, OMO);
    if Type is Non-Terminal-node then begin
        Sympathy-Objects = call ora-two-recursive-collect-terminal-nodes (Target, OMO);
        {   Sort to failed nodes  }
        for Dev = each object in Sympathy-Objects do
            Node-failed = call _ora-two-state-is-fail (Dev,OMO);
            if Node-failed is false then 
                remove Dev from Sympathy-Objects;
        end;
        {  for Dev = each  } {  clear the alarm if no test of pred. poll fail  }
        if the ora-two-recovery-poll-predicted-fail-nodes of OMO is false then begin
            for Dev = each object in Sympathy-Objects do
                Node-failed = call _ora-two-state-is-fail (Dev,OMO);
                if Node-failed is false then begin
                    remove Dev from Sympathy-Objects;
                    call _ora-two-set-state (Dev, the symbol _an-ora-two-RECOVERED-OBJECT-OF , OMO);
                end; {Node-failed}
            end; {for Dev = each }
        end; {if recovery-poll}
        {    Poll the bad nodes   }
        if the first object in Sympathy-Objects exists then begin
            Fail-Lst = call _ora-two-poll-device-list (OMO, Sympathy-Objects);
            for Dev = each object in Sympathy-Objects do
                {  Passed the poll, clear the message }
                call _ora-two-set-state (Dev, the symbol _an-ora-two-RECOVERED-OBJECT-OF , OMO);
            end;
            {  did not pass the poll, send message   }
            for Dev = each object in Fail-Lst do
                State = call _ora-two-get-state (Dev, OMO);
                if State /= the symbol _an-ora-two-root-cause-object-of then begin
                    call _ora-two-set-state (Dev, the symbol _an-ora-two-root-cause-object-of , OMO); 
                end; {State}
            end; {Dev = each}
            delete Fail-Lst;
        end; {first object in sympathy}
        delete Sympathy-Objects;
    end; {non-terminal-node}
    {   Remove Target from recover list if it is a member   }
    if Target is a member of the _ora-two-active-recover-list of OMO then remove Target from the _ora-two-active-recover-list of OMO; 
end

ora-two-fail-method (Target: class object {the object that has received an indication that it is no longer responding }, OMO: class ora-two-manager-object {The ora-two-manager-object supporting target })
{This is the main driving routine to call when an object fails. ora-two will then analyze dependencies to determine the root cause for this failure.} 
Related-Objects: class _ora-two-item-list;
No-of-non-terminal-nodes:integer;
Sympathy-Objects: class _ora-two-item-list;
Fail-Lst: class _ora-two-item-list;
Dev: class object;
State: symbol;
Node-failed: truth-value;
Type: symbol;
begin 

    insert Target at the end of the _ora-two-active-fail-list of OMO;
    {   Check current state and exit if already in alert  }
    State = call _ora-two-get-state (Target, OMO);
    if State = the symbol _an-ora-two-root-cause-object-of or
        State = the symbol _an-ora-two-poll-fail-object-of then begin
        remove Target from the _ora-two-active-fail-list of OMO;
        return; 
    end;
    {Don't issue if we already have a poll fail message }
    if State /= the symbol _an-ora-two-POLL-FAIL-OBJECT-OF then 
        call _ora-two-set-state (Target, the symbol _an-ora-two-POLL-FAIL-OBJECT-OF , OMO);
    {If this is an update from predected failure then no further processing needed, exit }
    if State = the symbol _an-ora-two-PREDICTED-FAIL-OBJECT-OF then begin
        remove Target from the _ora-two-active-fail-list of OMO; 
        return;
    end;

 
    {    Collect Related Non-Terminal Objects  }
    Related-Objects = call ora-two-recursive-collect-non-terminal-nodes (Target, OMO);
    No-of-non-terminal-nodes = the number of elements in Related-Objects;
    { Remove those that have failure relations against them, they are thought to be dead, find the ones that are thought to be good }
    for Dev = each object in Related-Objects do
        {   if the device is not good, don't worry about processing it }
        Node-failed = call _ora-two-state-is-fail (Dev,OMO);
        if Node-failed is true or  Dev is a member of the _ora-two-active-fail-list of OMO then 
            remove Dev from Related-Objects;
    end;
    {    Poll the remaining thought to be good nodes   } 
    if the first object in Related-Objects exists then begin
        Fail-lst = call _ora-two-poll-device-list (OMO, Related-Objects); 
        for Dev = each object in Fail-lst do
            if Dev is not a member of the _ora-two-active-fail-list of OMO then begin
                {    The node was good, now it's bad, 'start' this routine again }
                insert Dev at the end of the _ora-two-active-fail-list of OMO;
                start ora-two-fail-method (Dev, OMO);
            end;
        end;
        delete Fail-lst;
    end;

    {  No good non-terminal nodes connected to Target  }
    if the first object in Related-Objects does not exist then begin
        if No-of-non-terminal-nodes = 0 then begin
            {  no non-terminal nodes, this must be a root cause  }
            if Target is not _an-ora-two-root-cause-object-of OMO then
                call _ora-two-set-state (Target, the symbol _an-ora-two-ROOT-CAUSE-OBJECT-OF , OMO);
        end else begin
           {    No good nodes, issue sympathy events  }
            Sympathy-Objects = call ora-two-recursive-collect-terminal-nodes (Target, OMO);
            for Dev = each object in Sympathy-Objects do
                Node-failed = call _ora-two-state-is-fail (Dev,OMO);
                if Node-failed is false then 
                    call _ora-two-set-state( Dev, the symbol _an-ora-two-predicted-fail-object-of , OMO);
            end; {Dev = each } 
            {    if this is connected to the setup object, this is root cause    }
            if there exists a ora-two-manager-object connected to Target then 
                call _ora-two-set-state (Target, the symbol _an-ora-two-ROOT-CAUSE-OBJECT-OF, OMO); 
            delete Sympathy-Objects;
        end; {no non-terminal nodes connected} 

    end else begin 
        { At least one good node, this is RC alarm, Check if any terminal nodes are connected  }
        Type = call ora-two-node-type (Target, OMO);
        if Type is Non-Terminal-node then begin
            Sympathy-Objects = call _ora-two-fail-non-terminal-find-test-terminal-nodes (OMO,Target);
            Fail-Lst = call _ora-two-poll-device-list ( OMO, Sympathy-Objects);
            for Dev = each object in Fail-Lst do
                insert Dev at the end of the _ora-two-active-fail-list of OMO;
                start ora-two-fail-method (Dev, OMO);
            end; {for Dev}
            delete Sympathy-Objects;
            delete Fail-Lst;
        end; {Type}
        if Target is not _an-ora-two-root-cause-object-of OMO then 
            call _ora-two-set-state (Target, the symbol _an-ora-two-ROOT-CAUSE-OBJECT-OF , OMO);
    end; 
    {   Used for redundant checking of objects    }
    delete Related-objects;
    if Target is a member of the _ora-two-active-fail-list of OMO then
        remove Target from the _ora-two-active-fail-list of OMO; 
end

ora-two-domain-consistency-check (OMO:class ora-two-manager-object {Manager node to collect related nodes}) = (class _ora-two-item-list { List of lists containing unrelated nodes } )
{This routine returns a list of lists, each list contains objects that are related together by ora-two methods but are not related to the manager object.  Only clusters with more than one member are included.
Note that this routine traverses the entire domain related to the manager object and may cause heavy system loading.}
Related-nodes:class ora-two-cluster-list ;
All-nodes-list:class _ora-two-item-list; 
Unrelated-nodes:class ora-two-cluster-list ; 
Unrelated-nodes-list-of-lists:class _ora-two-item-list; 
Node:class object;
begin
All-nodes-list = call ora-two-collect-all-domain-nodes (OMO); 
transfer All-nodes-list to this workspace; 
Related-nodes = call _ora-two-collect-related-nodes (the object connected to OMO, OMO);
transfer Related-nodes to this workspace;

for Node = each object in Related-nodes do
    if Node is a member of All-nodes-list then
        remove Node from All-nodes-list;
end;
create an _ora-two-item-list Unrelated-nodes-list-of-lists;
transfer  Unrelated-nodes-list-of-lists to this workspace;
{ Nodes left in All-nodes-list are not related to the manager }
repeat
    exit if the first object Node in All-nodes-list does not exist; 
    remove Node from All-nodes-list;
    allow other processing;
    Unrelated-nodes = call _ora-two-collect-related-nodes (Node, OMO);
    for Node = each object in Unrelated-nodes do
        if Node is a member of All-nodes-list then 
            remove Node from All-nodes-list; 
    end;
    if the number of elements in Unrelated-nodes <= 1 then
        delete Unrelated-nodes
    else
        insert Unrelated-nodes at the end of Unrelated-nodes-list-of-lists; 
end;
delete All-nodes-list;
delete Related-nodes;
return Unrelated-nodes-list-of-lists; 
end

ora-two-root-cause-method (Target:class object {an object}, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target})
{This method determines the actions to be taken when an object is a root cause of failures, the response may be to post a message, spawn an event, start OPAC, etc.}
begin
{start smh-create-message (smh-browse-server , Target, Target, "ORA-TWO Message", "[the name of Target] is a root cause", "", -1,1, -1, false, OMO, "-r");}
end

ora-two-poll-fail-method (Target:class object {an object}, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target})
{This method determines the actions to be taken when an object fails a poll, the response may be to post a message, spawn an event, start OPAC, etc.}
begin
{start smh-create-message (smh-browse-server , Target, Target, "ORA Message", "[the name of Target] failed a poll", "", -1,3, -1, false, OMO, "-r");}
end

ora-two-predicted-fail-method (Target:class object {an object}, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target})
{This method determines the actions to be taken when an object is predicted to fail, the response may be to post a message, spawn an event, start OPAC, etc.}
begin
{start smh-create-message (smh-browse-server , Target, Target, "ORA Message", "[the name of O] is predicted to fail", "", -1,5, -1, false, OMO, "-r");}
end

ora-two-poll-recover-method (Target:class object {an object}, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target})
{This method determines the actions to be taken when an object recovers from a failure, the response may be to post a message, spawn an event, start OPAC, etc.}
begin
{start smh-create-message (smh-browse-server , Target, Target, "ORA Message", "[the name of O] has recovered polling", "", -1,6, -1, false, OMO, "-r");}
end

ora-two-collect-passive-nodes (Target:class object {an object} , LST:class _ora-two-item-list {The list to append Targets passive-nodes to} , OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target} ) 
{ora-two-collect-passive-nodes collects the passive-nodes directly associated with Target.  Any g2 construct can be used to collect passive-nodes can be used to collect directly associated nodes.  Common constructs are connectivity, workspace, and subworkspace relationships.} 
DEV:class object;
NodeType: symbol;
begin
for DEV = each object connected to Target do
    NodeType = call ora-two-node-type (Dev, OMO);
    if NodeType is PASSIVE-node then 
        insert DEV at the end of LST;
end; 
end

ora-two-collect-terminal-nodes (Target:class object {an object} , LST:class _ora-two-item-list {The list to append Targets terminal-nodes to} , OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target} ) 
{ora-two-collect-terminal-nodes collects the terminal-nodes directly associated with Target.  Any g2 construct can be used to collect terminal-nodes can be used to collect directly associated nodes.  Common constructs are connectivity, workspace, and subworkspace relationships.} 
DEV:class object;
NodeType: symbol;
begin
for DEV = each object connected to Target do
    if Dev is not an ora-two-manager-object then begin
        NodeType = call ora-two-node-type(Dev, OMO);
        if NodeType is TERMINAL-NODE then 
            insert DEV at the end of LST;
    end;
end; 
end

ora-two-collect-non-terminal-nodes (Target:class object {an object} , LST:class _ora-two-item-list {The list to append Targets non-terminal-nodes to}, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target} )
{ora-two-collect-non-terminal-nodes collects the non-terminal-nodes directly associated with Target.  Any g2 construct can be used to collect non-terminal-nodes can be used to collect directly associated nodes.  Common constructs are connectivity, workspace, and subworkspace relationships.}
DEV:class object;
NodeType: symbol;
begin
for DEV = each object connected to Target do
    NodeType = call ora-two-node-type (Dev, OMO);
    if NodeType is NON-TERMINAL-NODE then 
        insert DEV at the end of LST;
end; 
end

ora-two-poll-node (Target:class object {an object} , OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target} ) = (symbol {The state of the object, OK / FAIL})
{ora-two-poll-node that is responsible for polling Target and returning its state.  If the Target polls successfully, then return the symbol OK.  If the Target fails to poll, then return the symbol FAIL.}
node-State:symbol = the symbol OK;
begin
if the _opfo-acknowledgement-status of Target is unacknowledged then 
    node-State = the symbol FAIL;
return node-State;
end

ora-two-node-type (Target:class object {an object}, OMO: class ora-two-manager-object {the ora-two-manager-object responsible for target}) = (symbol {The target's node type: non-terminal-node, terminal-node, or passive-node})


{Ora-two-node-type is used to determine the type of the node.  There are 3 valid types: non-terminal-node, terminal-node, and passive-node.  Non-terminal-nodes are devices that others depend upon and thus lead to other nodes.  An ethernet card in a router is an example of a non-terminal-node.  Terminal-nodes are end-use devices.  Ethernet cards in user workstations are typically terminal-nodes.  Passive-nodes are devices whose state is unknown and are untestable.  Connectors and transcievers are examples of passive-nodes.}

Type: symbol = the symbol TERMINAL-NODE;
SupObj: class object;
isConnected: integer;
Card, Intf: class ipra-interface;
ErrorObj: class g2-error;
Wksp: class kb-workspace;

Begin

    if the node-type of Target /= the symbol UNKNOWN then
        return the node-type of Target
    else
    begin      
       SupObj = the ipra-domain-object that is dxi3-superior-to Target;
       {any interface of a device which routes/switches pkts is a
non-terminal node}
       if SupObj is an ipra-packet-wrangler then
           Type = the symbol NON-TERMINAL-NODE
       else if there exists an ipra-network-segment Seg that is
dxi3-connected-to Target then
           Type = the symbol NON-TERMINAL-NODE;
    end;
    conclude that the node-type of Target = Type; 

    return Type; 

End 

on error (ErrorObj)

    inform the operator for the next 2 minutes that "[the error-description of ErrorObj]";
    delete ErrorObj without permanence checks;

end

g2:c.PROCEDURE.g2:a.TEXT:
_ora-two-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces;
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert _ora-two-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert _ora-two-internals at the end of the item-list named by intstuffName;


end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end
